INSERT INTO `categories` (`id_category`, `name`, `description`) VALUES
(11, 'Nawozy', 'Nawozy – środki używane w uprawie roślin (nawożenie) celem zwiększenia wysokości i jakości plonowania dzięki wzbogaceniu gleby w składniki pokarmowe niezbędne dla roślin i polepszeniu jej właściwości fizycznych, fizykochemicznych, chemicznych i biologicznych, pochodzenia mineralnego lub organicznego. Nawozami są również produkty przeznaczone do zwiększania żyzności stawów rybnych.  W zależności od nawozu, zawarte w nim składniki pokarmowe mogą być w formie bezpośrednio przyswajalnej przez rośliny lub też dopiero po przemianach zachodzących w glebie, przez co działanie nawozów może trwać w ciągu jednego roku nawożenia lub nawet 3-5 następnych lat (np. wióry rogowe na ciężkich glebach). Czasem składniki pokarmowe w wyniku przemian glebowych przechodzą w formę trudniej przyswajalną lub całko'),
(12, 'Rośliny zielone', 'Roślina zielna – roślina o zielonej, niezdrewniałej lub w niewielkim stopniu zdrewniałej łodydze, z nagimi pąkami [1][2]. Łodyga roślin zielnych okryta jest skórką (epidermą), pod którą znajduje się kora pierwotna i tkanki przewodzące (u roślin u jednoliściennych rozrzucone na całym przekroju, u dwuliściennych ułożone w formie pierścienia z wypełnionym miękiszem rdzeniem). Pędy roślin zielnych bywają zmodyfikowane w różnorodny sposób w zależności od funkcji oraz działalności merystemu wierzchołkowego decydującego o ulistnieniu i ułożeniu pąków[2]. W klimacie umiarkowanym pędy naziemne roślin zielnych są nietrwałe i obumierają z końcem sezonu wegetacyjnego'),
(13, 'Sukulenty', 'Sukulenty, rośliny gruboszowate (łac. succulentus – soczysty) – grupa kserofitów, rośliny, które przystosowały się do życia w warunkach ograniczonej dostępności wody wykształcając tkankę wodną służącą do jej gromadzenia oraz szereg dalszych adaptacji w budowie i fizjologii[1][2]. Występują najczęściej na obszarach pustynnych, jednak spotykane są we wszystkich strefach klimatycznych, choć rzadko w Australii i w rejonach chłodnych[3]. Dominują wśród nich rośliny dwuliścienne, zwykle rośliny zielne, rzadko drzewa[2]. Wielu przedstawicieli sukulentów uprawia się jako rośliny ozdobne.');

