INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(23, 'Płynny nawóz do kaktusów i sukulentów', 'Dzięki systematycznemu nawożeniu kaktusy i sukulenty mają zapewniony zdrowy wzrost, zwiększa się ich odporność na choroby, lepszy jest też proces kwitDzięki systematycznemu nawożeniu kaktusy i sukulenty mają zapewniony zdrowy wzrost, zwiększa się ich odporność na choroby, lepszy jest też proces kwitnienia. Zrównoważony skład utrzymuje kaktusy i sukulenty w doskonałej kondycji, a bezpieczny i prosty system dozowania znacznie usprawnia pielęgnację roślin domowych.  Nawóz w płynie dodaj się do wody podczas podlewania. 8-10 ml (1/4 nakrętki) nawozu wlej do 2 l wody i delikatnie zamieszaj. Stosuj przy każdym podlewaniu w okresie od kwietnia do września.', 13, , 0, 0, 0, 'Brak', 11);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(24, 'Ziemia Do Kaktusów I Sukulentów', 'Ziemia do kaktusów i sukulentów to specjalistyczne podłoże przygotowane z myślą o sadzeniu i przesadzaniu kaktusów i innych sukulentów.   Kaktusy i sukulenty w swoim naturalnym środowisku rosną w trudnych i wymagających warunkach, dlatego stworzyliśmy podłoże, które dopasowuje się do ich potrzeb. Zastosowane w podłożu w znacznych ilościach dodatki mineralne, takie jak keramzyt, powodują, że struktura podłoża jest porowata i przepuszczalna. Pomaga to regulować gospodarkę powietrzną i wodną, zapobiega zastojowi wody i chroni korzenie przed nadmiarem wilgoci.  Ziemia zawiera odpowiednią dawkę mikro i makro elementów niezbędnych do prawidłowego wzrostu roślin. Podłoże wieloskładnikowe, gotowe do użycia.  Kilka przydatnych informacji : - kaktusy lubią dobre nasłonecznienie, można je uprawiać na parapetach od strony południowej, a także w szklarniach i oranżeriach. Wyjątkiem są kaktusy szczepione (kolorowe główki) które nie powinny stać w pełnym słońcu. - podlewanie powinno być bardzo oszczędne, zwłaszcza w okresie zimowego spoczynku. W tym czasie dobrze wpływa na nie obniżenie temperatury otoczenia do 10-15 stopni. - przesadzanie kaktusów najlepiej wykonać jesienią lub zimą, należy przy tym uważać aby nie uszkodzić systemu korzeniowego roślin, a bryłę korzeniową delikatnie oczyścić z obumarłych części. - sadząc roślinę w pojemniku nie zapominamy o warstwie drenażu, np. keramzyt Biovita.', 20, , 5, 4, 3, 'Brak', 11);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(25, 'Monstera deliciosa Monstera dziurawa', 'Okazałe, wieloletnie, silnie płożące się pnącze o bardzo okazałych, dużych liściach. W naturze występuje na terenach lasów tropikalnych Ameryki Środkowej i Południowej. Ozdobą tego niezwykłego gatunku są bardzo duże liście średnicy nawet 60 cm. Monstera deliciosa wytwarza również liczne korzenie powietrzne, które nadają tej roślinie charakteru i umożliwiają jej pięcie się w górę. Młode liście są jasno zielone, z czasem jednak nabierają ciemniejszego koloru, a na ich powierzchni pojawiają się charakterystyczne wcięcia i dziury. Dorosłe okazy zaskakują ciekawym kwitnieniem. Wytwarzają piękne, kolbiaste kwiatostany, otoczone kremową, pochwiastą przysadką. Roślina wydaje również jadalne owoce o smaku kwaśnego ananasa, które jednak rzadko pojawiają się w warunkach domowych. Monstera deliciosa zachwyca rozmiarem, pokrojem, egzotycznym wyglądem, a dodatkowo posiada niewielkie wymagania uprawowe. Starsze osobniki osiągają nawet 300 cm wysokości, ich wzrost jest jednak powolny.', 15, , 3, 2, 4, 'Roślina pyląca w czerwcu.', 12);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(26, 'Monstera adansonii', 'Monstera adansonii jest obok Monstery deliciosa najchętniej uprawianą i pożądaną monsterą w domowej dżungli. Obie należą do rodziny obrazkowatych, z tMonstera adansonii jest obok Monstery deliciosa najchętniej uprawianą i pożądaną monsterą w domowej dżungli. Obie należą do rodziny obrazkowatych, z tym, że M. adansonii jest dużo mniejszym i niższym gatunkiem, a co za tym idzie, na jej uprawę mogą sobie pozwolić właściciele nawet niewielkich pomieszczeń. Monstera adansonii pochodzi z Amazonii, rośnie w naturze głównie w Peru, Ekwadorze i Brazylii. Zachwyca oryginalnym wyglądem liści i atrakcyjnym, pnącym pokrojem. Chociaż w naturze lubi się również płożyć, to w uprawie domowej najlepiej radzi sobie prowadzona przy pionowych palikach i w taki sposób zdecydowanie najładniej rośnie. Uprawiana w formie pnącej osiąga ok. 1m wysokości. Jej niekwestionowanym atrybutem są piękne, ażurowe liście, których ok. 50% powierzchni stanowią dziury. Blaszka liściowa jest dość sztywna, o całych i lekko falowanych brzegach. Środek liścia jest mocno perforowany, przy czym dziury rozmieszczone są ukośnie do nerwu głównego i przybierają postać owalnych i podłużnych okienek. Liście młodych roślin osiągają ok. 10 cm i mają niewiele małych okienek, natomiast dorosłe okazy zachwycają znacznie większymi dziurami, a blaszka liściowa jest smuklejsza, bardziej pomarszczona i może osiągać nawet 50 cm długości. Ulistnione długie pędy mają tendencję do wytwarzania korzeni powietrznych, za pomocą których wspinaj', 19, , 6, 4, 3, 'Roślina pyląca w maju.', 12);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(27, 'Epiphyllum guatemalense', 'Oszałamiający kaktus o zaskakującym kształcie. Posiada skręcone, spiralne, zakrzywione łodygi o jasnozielonym kolorze, przypominające liście. W naturalnym środowisku kształt łodyg pomaga zgromadzić roślinie jak największą ilość światła i wilgoci. Gatunek ten występuje w tropikalnych dżunglach. Zaliczany jest do epifitów, czyli roślin, które rosną w koronach drzew, podobnie jak np. storczyki. Z tego względu kaktusy te nazywane są także roślinami powietrznymi (air plant) podobnie jak oplątwy. Epifyllum wytwarza białe kwiaty o szerokości około 7 cm, które otwierają się w nocy. Dzieje się tak, ponieważ w naturze kwiaty są zapylane przez ćmy i nietoperze, a te nocne zwierzęta z łatwością dostrzegają duże, białe kwiaty. Po zapyleniu kwiatów powstają owalne, jasnoróżowe owoce, które są jadalne. Roślina jest również samopylna, a owoce mogą tworzyć się nawet bez pomocy owadów i ssaków. Te niezwykłe rośliny bywają często nazywane Kaktusami Storczykowymi. Najładniej prezentują się jako rośliny zwisające, które tworzą z czasem imponujące girlandy o spiralnych łodygach!', 40, , 3, 4, 2, 'Roślina pyląca w maju.', 12);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(28, 'Ficus elastica Robusta Figowiec sprężysty', 'Fikus sprężysty to efektowna roślina domowa, która wciąż nie wychodzi z mody. Gatunek ten pochodzi z Półwyspu Indyjskiego, Indochin i Malezji. Odmiana \'Robusta\' zachwyca elegancką formą oraz cudownym, dekoracyjnym ulistnieniem. Rośnie dość szybko i maksymalnie osiąga około 150 cm wysokości', 7, , 3, 4, 1, 'Roślina pyląca we wrześniu.', 12);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(30, 'Echeveria purpusorum', 'Echeveria purpusorum to wolno rosnący gatunek sukulenta o pięknym, purpurowym wybarwieniu z ciemnymi cętkami na liściach. Gatunek sukulenta tworzący pojedyncze, zwarte rozety o skórzastych, połyskujących liściach. Niezwykłe ubarwienie blaszki liściowej: oliwkowo-purpurowa powierzchnia liścia pokryta ciemnymi cętkami, oraz wyraźnie zaznaczony, fioletowy margines liści. Latem roślina dodatkowo wytwarza ozdobne kwiaty w kolorze czerwono-pomarańczonym. ', 7.49, , 3, 3, 3, 'Roślina pyląca w czerwcu.', 13);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(31, 'Sedum hernandezii', 'Piękny, drobny sukulent o minimalistycznej formie i jednolitej kolorystyce. Owalne, wydłużone liście gęsto oblepiają wolno przyrastające pędy tworząc początkowo małe kępki, a później niewielkie drzewka. Liście są mięsiste, twarde  i połyskujące. Ich szmaragdowa barwa w połączeniu z połyskującą fakturą oraz interesującym kształtem tworzą harmonijną całość. Osiąga wysokość około 10-25 cm przyrastając raczej powoli. Zimą i wczesną wiosną na szczytach pędów pojawiają się złociste kwiaty w kształcie drobnych gwiazdek.', 9.99, , 4, 3, 1, 'Roślina bezpieczna, idealna dla alergików', 13);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(32, 'Portulacaria afra', 'Portulacaria afra jest sukulentem, który w naturze rośnie w południowo-wschodniej RPA. Tworzy pokrój krzewiasty lub formę małego drzewka i w warunkach naturalnych osiąga od 2 do 5 m wysokości. Z wyglądu bardzo przypomina grubosza (Crassula ovata), jednak cechuje się mniejszymi i gęściej ułożonymi liśćmi oraz bogatszym rozgałęzieniem pędów. Z nabrzmiałego grubszego pędu, który przypomina mały pień wyrasta mnóstwo rozgałęziających się cieńszych pędów zakończonych mięsistymi, owalnymi i zielonymi liśćmi.', 7.99, , 3, 3, 3, 'Roślina pyląca w maju.', 13);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(33, 'Nawóz w płynie do paproci ', 'Dzięki systematycznemu nawożeniu paprocie mają zapewniony zdrowy wzrost, ich liście są intensywnie zielone, wzrasta też znacznie ich odporność na choroby. Zrównoważony skład utrzymuje paprocie w doskonałej kondycji, a bezpieczny i prosty system dozowania znacznie usprawnia pielęgnację roślin domowych.', 12.99, , 0, 0, 0, 'Brak', 11);
INSERT INTO `products` (`id_product`, `name`, `description`, `price`, `img`, `insolation`, `watering_frequency`, `difficulty_of_growing`, `allergens`, `id_category`) VALUES
(34, 'Opuntia macrocalyx', 'Opuncja macrocalyx jest sukulentem z rodziny kaktusowatych, który w naturze porasta głównie pustynne obszary Meksyku. Nie posiada typowych kłujących cierni, lecz maleńkie włoskowate glochidy, zebrane w równomiernie rozmieszczone grupki. Mimo, że z wyglądu sprawiają wrażenie miękkich i pluszowych, glochidy są w rzeczywistości kruche, łamliwe i zakończone haczykowato, co pomaga im wczepiać się w skórę. Dotyk opuncji macrocalyx nie należy do przyjemnych, ponieważ glochidy mogą powodować podrażnienia skóry. Nie zraża to jednak kolekcjonerów tych pięknych sukulentów, gdyż walory ozdobne i łatwość w uprawie wynagradzają z nawiązką jej osobliwe obronne zachowanie.', 9.99, , 3, 4, 4, 'Roślina bezpieczna, idealna dla alergików', 13);

